create database Drug_db;

drop table drug_sale;

create table drug_sale (
Id bigint,
First_name varchar(20),
Last_name varchar(20),
Gender varchar(15),
Date date,
Drug_brand varchar(100),
Drug_name varchar(100),
City varchar(50),
sale bigint,
State varchar(50),
Phone bigint
)


select * from drug_sale;

select  max(sale) from drug_sale;

select COUNT(*)  from drug_sale;

select distinct state from drug_sale;
select count(distinct state) from drug_sale;

select distinct City from drug_sale;
select count(distinct City) from drug_sale;

select sum(sale) as "Total Sale" from drug_sale;

select State, sum(sale) as "Total sale" from drug_sale
group by(State)
order by State ASC;

select State, sum(sale) as "Total sale" from drug_sale
group by(State)
order by "Total sale" DESC;

select City, sum(sale) as "Total sale" from drug_sale
group by(City)
order by City ASC;

select City, sum(sale) as "Total sale" from drug_sale
group by(City)
order by "Total sale" DESC;

select top 5 State, sum(sale) as "Total sale" from drug_sale
group by(State)
order by "Total sale" DESC;

select top 5 City, sum(sale) as "Total sale" from drug_sale
group by(City)
order by "Total sale" DESC;

select Drug_name from drug_sale
where Drug_name like 'A*';